import React from 'react'
import { Box, Paper, DialogTitle, Dialog, DialogContent, Switch } from '@material-ui/core'
import { withStyles } from '@material-ui/core/styles'
import PropTypes from 'prop-types'
import Text from '../text'

const styles = (theme) => ({
    root : {
        width : "100vw",
        height : "100vh",
        backgroundColor : "rgba(0,0,0,0.3)",
        display : "flex",
        justifyContent : "center",
        alignItems : "center",
        position : "absolute",

    },
    map : {
        backgroundImage : 'url(/static/images/map.png)',
        backgroundRepeat : "no-repeat",
        backgroundSize : "cover",
        width : "100%",
        height : 300 
    },
    useCurrent : {
        display : "flex",
        justifyContent : "flex-around",
        alignItems : "center"
    }
})

const Location = ({ classes, handleClose, open }) => {
    return <Box className={classes.root}>
        <Dialog
        open={open}
        onClose={handleClose}
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
        fullWidth={true}
      >
        <DialogTitle id="alert-dialog-title"><Text variant="body1">Add new address."</Text></DialogTitle>
        <Box className={classes.map} />
        <DialogContent>
        <Box className={classes.useCurrent}>
            <Text variant="caption">Use Current Location</Text>
            <Switch
                // checked={state.checkedA}
                // onChange={handleChange}
                name="checkedA"
                inputProps={{ 'aria-label': 'secondary checkbox' }}
            />
        </Box>

        </DialogContent>
      </Dialog>
    </Box>
}

Location.propTypes = {
    open : PropTypes.bool,
    handleClose : PropTypes.func,
    // eslint-disable-next-line react/forb,id-prop-types
    classes: PropTypes.object.isRequired,
}

export default withStyles(styles)(Location)
